class Solution(object):
    def generatePalindromes(self, s):
        """
        :type s: str
        :rtype: str
        """
        if len(s) == 1:
            return s
        if len(s) == 2:
            if s[0] == s[1]:
                return s
            else:
                return s[0] + s[1] + s[1] + s[0]
        else:
            d = {}
            for i in s:
                if i not in d:
                    d[i] = 1
                else:
                    d[i] += 1
            odd = 0
            for i in d:
                if d[i] % 2 == 1:
                    odd += 1
            if odd > 1:
                return "NA"
            else:
                res = ""
                for i in d:
                    if d[i] % 2 == 1:
                        res += i
                if len(res) == 1:
                    return res + res[::-1]
                else:
                    return res[0] + res[1:] + res[0] + res[1:][::-1]

